import React from 'react';
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles( theme => {
    root: {
        flexGrow: 1
    }
})
export default function cdnGrid() {
    const style = useStyles();

    return (
        <div className={style.root}></div>
    );
}
